import styled from 'styled-components';

export const MainAppWrapper = styled.div`
  max-width: 1140px;
  margin: 0 auto;
  background: ${props => props.test ? 'black' : 'white'};
  transition: all .2s ease-in;
  color: ${props => props.test ? 'white' : 'black'}
`;
